import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { Carros } from './carros';

@Injectable({
  providedIn: 'root'
})
export class CarrosService {
  pdateCarros(id: number, carros: Carros) {
